import React from 'react'

export const GlobalFilter = ({filter, setFilter}) => {
  return (
    <div>
        <span>
            <h1 className="py-2 text-gray-800 font-bold">Фильтр</h1>
            <input value={filter || ''} onChange={e=>setFilter(e.target.value)} placeholder="Поиск" className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 mb-3 leading-tight focus:outline-none focus:shadow-outline"/>
        </span>
    </div>
  )
}
